import React from 'react';
import Header from '../components/Header';

function FavoriteRecipes() {
  return (
    <>
      <Header title="Favorite Recipes" hasSearch={ false } />
      <p>Favorite Recipes</p>
    </>
  );
}

export default FavoriteRecipes;
